Assuming xplr is installed and setup , let's add our own mode to integrate xplr with fzf . We'll call it fzxplr mode. First, let's add a custom mode called fzxplr, and map the key F to an action that will call fzf to search and focus on a file or enter into a directory. xplr.config.modes.custom.fzxplr = { name = "fzxplr", key_bindings = { on_key = { F = { help = "search", messages = { { BashExec = [===[ PTH=$(cat "${XPLR_PIPE_DIRECTORY_NODES_OUT:?}" | awk -F/ '{print $NF}' | fzf) if [ -d "$PTH" ]; then echo ChangeDirectory: "'"${PWD:?}/${PTH:?}"'" >> "${XPLR_PIPE_MSG_IN:?}" else echo FocusPath: "'"${PWD:?}/${PTH:?}"'" >> "${XPLR_PIPE_MSG_IN:?}" fi ]===] }, "PopMode", }, }, }, default = { messages = { "PopMode", }, }, },
} As you can see, the key F in mode fzxplr (the name can be anything) executes a script in bash. BashExec, PopMode, SwitchModeBuiltin, ChangeDirectory and FocusPath are messages , $XPLR_PIPE_MSG_IN, $XPLR_PIPE_DIRECTORY_NODES_OUT are environment variables exported by xplr before executing the command. They contain the path to the input and output pipes that allows external tools to interact with xplr. Now that we have our new mode ready, let's add an entry point to this mode via the default mode. xplr.config.modes.builtin.default.key_bindings.on_key["F"] = { help = "fzf mode", messages = { { SwitchModeCustom = "fzxplr" }, },
} Now let's try out the new xplr-fzf integration. xplr-fzf.gif

