xplr allows users to define lua functions using the xplr.fn.custom Lua API. These functions can be called using messages like CallLua, CallLuaSilently. When called the function receives a special argument that contains some useful information. The function can optionally return a list of messages which will be handled by xplr. Example: -- Define the function
xplr.fn.custom.ask_name_and_greet = function(app) print("What's your name?") local name = io.read() local greeting = "Hello " .. name .. "!" local message = greeting .. " You are inside " .. app.pwd return { { LogSuccess = message }, }
end -- Map the function to a key (space)
xplr.config.modes.builtin.default.key_bindings.on_key.space = { help = "and & greet", messages = { { CallLua = "custom.ask_name_and_greet" } }
} -- Now, when you press "space" in default mode, you will be prompted for your
-- name. Enter your name to receive a nice greeting and to know your location.
